objet:
- être un lieu de rassemblement de citoyen (s), de militant (s) issu (s) du monde associatif, syndical et politique ;
- être un lieu de débats et d'échanges ;
- mettre en commun l'information pour une sensibilisation citoyenne ;
- fédérer nos énergies pour comprendre et agir à tous les niveaux possibles pour mettre en place un véritable débat démocratique sur tous les enjeux importants de notre société ;
- proposer une alternative à la mondialisation libérale afin de replacer le (la) citoy

- Créer une structure de rencontre entre les personnels ayant fait partie et faisant partie du PGHM 05 ;
- améliorer le confort et la qualité de vie professionnelle et familliale ;
- promouvoir l'action culturelle, sociale et sportive au profit des personnels du PGHM 05, de leurs familles et amis ;
- acquérir du matériel spécifique aux missions de secours en montagne.

- préserver les intérêts des élèves (enfants et adultes) sur tout objet concernant l'éducation musicale, chorégraphique et théâtrale, favoriser l'échange des informations entre la direction et les parents, participer à la vie de l'école ;
- appuyer la direction de l'ecole dans ses démarches auprès de la municipalité ou autre ;
- représenter les parents, les élèves et amis auprès des pouvoirs publics ;
- susciter, soutenir et développer toute action musicale ou théâtrale avec éducateurs.

-- Grouper les chefs de famille ayant la charge des enfants inscrits à l'école ;
- toutes activités susceptibles d'apporter un soutien matériel et moral à l'école, aux familles et aux maîtres ;
- l'entente avec toutes associations semblables.
A cet effet, l'association adhère à l'APEL départementale ainsi qu'à l'APEL de la région académique elle-même fédérée à l'Union Nationale des Associations de Parents d'Elèves de l'Enseignement Libre.

- Conserver et renforcer les liens d'amitié et de camaraderie qui unissent les anciens marins dans le souvenirs des joies, des efforts, des dangers et aussi des sacrifices vécus en commun au service de la France ;
- faciliter par tous les moyens, l'entraide maritime sous toutes ses formes ;
- contribuer à l'éducation populaire, particulièrement de la jeunesse en l'orientant vers la Marine par tous moyens dont dispose l'Amicale ;
- faire toute propagande maritime nécessaire.

étudier et d'apporter aux administrations et leurs établissements publics, aux collectivités locales et à toute autre personne physique ou morale concernée, son avis tendant à préserver la sécurité, la propreté, et plus généralement le cadre de vie des riverains et usagers de l'Avenue de Provence (Commune de Briançon - 05100) ;
 favoriser la participation des riverains aux débats publics, concertations, enquêtes publiques et toutes autres formes de consultations ayant trait à l'aménagement du cadre de vie et à la propriété des riverains ;
susciter et encourager la création d'associations partenaires en lien avec la défense des riverains et les problématiques ayant trait à la riveraineté dans le briançonnais ;
promouvoir par tous types d'actions un urbanisme responsable, et surtout respectueux des droits des riverains, notamment du point de vue de la tranquillité, de la sécurité, de l'aménagement des abords et la libre circulation des personnes ; 
lutter contre les risques, pollutions et nuisances générés notamment par les usagers de la route et le non-respect des règles de sécurité routière ; de développer la prise en compte et l'éveil du public au respect des riverains et aux règles de sécurité routière ;
veiller à la prise en compte et au respect du bien être des riverains lors de toutes projections ou tous projets d'urbanisation impactant directement ou indirectement le quartier de l'Avenue de Provence et pouvant nuire à la qualité de vie de ses riverains et usagers ;
défendre, le cas échéant, et par les voies appropriées les intérêts collectifs de ses membres, notamment en ce qui concerne la protection de leur sécurité, leur cadre de vie, leur droit à la libre circulation et de leur droit de propriété

réunir toutes les sensibilités de l'écologie sans idéologie arbitraire, pouvoir participer à la vie publique par tous les moyens nécessaires et défendre ses valeurs au niveau local, régional et / ou National ; 
défendre une éthique écologique au service de la modernité, une écologie avec une harmonie de l'Homme dans son environnement, une écologie transversale ; défendre un éco-modernisme et une écologie circulaire ; défendre la responsabilité écologique ; permettre de réconcilier économie et écologie avec une approche pragmatique ; 
réunir toutes les personnes ayant la fibre écologique et se reconnaissant dans les valeurs de la droite et du centre-droit

Financer la prévention et la recherche des affections cardiaques;
Réunir amicalement des personnes souffrant ou non d'affections cardio-vasculaires.
Soutien moral de ses membres et de toutes personnes atteintes de maladies cardio-vasculaires.

informer et conseiller toutes les personnes en difficulté financière, particuliers, professionnels, entrepreneurs et personnes morales de droit privé ;
accompagner la personne en difficulté financière - particulier ou professionnel - dans ses démarches administratives, légales et budgétaires ; aider à la constitution des dossiers de surendettement des particuliers transmis à la banque de France ;	proposer et accompagner la mise en place de micro-crédit en faveur des personnes exclues du système financier ; 
sensibiliser l'opinion publique aux problèmes de surendettement et à ses conséquences ;	former des intervenants sociaux des collectivités, confrontés dans leurs missions quotidiennes aux problèmes de surendettement ; organiser des groupes de paroles et d'échange d'expériences destinés à rompre l'isolement lié au surendettement ; -	animer des permanences de proximité en collaboration avec les collectivités locales ; participer aux réunions de la Fédération Crésus à laquelle l'association demande son adhésion et l'informer de ses actions, conséquence du droit d'usage du nom Crésus octroyé par la Fédération après intégration régulière de l'association

réunir les acteurs intéressés par la conception, la création, la
réparation ;  mise à disposition d'un lieu : travailler en indépendance, échanger des connaissances  ; 
organiser des événements

promouvoir, développer, organiser, faciliter la pratique de L'ULM, des Drones et des différentes activités s'y rattachant, notamment par des opérations de découverte auprès du public, par la formation et l'entraînement des pilotes, tant à l'aide de moyens privés que de moyens d'état, à effet de préparer aux carrières aéronautiques, à la construction aéronautique, à l'instruction technique ou aux métiers s'y rattachant ; 
faire respecter les règles et les règlements techniques et déontologiques ; 
exercer un pouvoir disciplinaire, dans le respect des principes généraux du droit, à l'égard des membres ; 
développer l'esprit aéronautique particulièrement dans la jeunesse, de veiller à ce que le vol moteur, école de maîtrise individuelle et activité d'équipe, soit à la fois une activité de formation, un sport et un loisir ; 
participer à l'étude, la réalisation et la gestion d'infrastructures aéronautiques : aérodromes, avitaillement, installations techniques et d'accueil 
L'association est affiliée à la Fédération Française d'ULM « FFPLUM » ; 
Elle s'engage à se conformer entièrement aux règlements établis par la Fédération, les Comités Régionaux et le Comité National Olympique et Sportif Français

faciliter l'accès à la culture, l'écriture, la littérature de tout public ; 
proposer la pratique d'ateliers d'écriture, d'ateliers de lecture et plus largement des activités d'expression autour de l'écriture, la lecture et de tout autre art ; 
organisation et participation à des manifestations culturelles et expositions portant sur une thématique littéraire et/ou artistique ; 
proposition et organisation des ateliers d'écritures et toutes activités connexes contre rémunération, qui sont des activités économiques au sens de l'article L 442-7 du Code de Commerce, ainsi que toutes manifestations et expositions concourant à la réalisation de son objet ; 
développer une activité de vente permanente ou occasionnelle de tous produits ou services concourant à la réalisation de son objet ; 
promouvoir une ou des actions à caractère humanitaire développée par une ou des associations tiers ayant cet objet

remplir une mission de service public pour l'orientation et l'insertion professionnelle et sociale des jeunes de 16 à 25 ans révolus et sortis du système scolaire, confiée par l'État, les collectivités territoriales et les établissements publics, chacun dans son champ de compétence ; 
aider les jeunes de seize à vingt-cinq ans révolus à résoudre l'ensemble des problèmes que pose leur insertion professionnelle et sociale en assurant des fonctions d'accueil, d'information, d'orientation et d'accompagnement à l'accès à la formation professionnelle initiale ou continue, ou à un emploi ; favoriser la concertation entre les différents partenaires ; contribuer à l'élaboration et à la mise en uvre, dans sa zone de compétence, d'une politique locale concertée d'insertion professionnelle et sociale des jeunes ; repérer, accueillir, informer et orienter les jeunes ; 
accompagner les parcours d'insertion ; agir pour l'accès à l'emploi ; 
gérer les différents dispositifs qui lui sont confiés par lÉtat ou toute autre collectivité publique, en sa qualité de Mission Locale ;
observer le territoire et apporter une expertise ;développer une ingénierie de projets et animer le partenariat local ;

préserver le site naturel dans lequel est inscrit le camping "les Ecolodges des 3 lacs" et ses abords, par ses membres actifs résidents ou non résidents ; aménager et mettre en valeur les sites gérés par l'association, surveiller leur évolution et les entretenir à l'aide de personnel rétribué ou des membres actifs bénévoles ; 
protéger, conserver, restaurer et maintenir le cadre de vie, les espaces, ressources, milieux et habitats naturels des espèces animales et végétales afin de préserver la diversité des équilibres fondamentaux écologiques ; soutenir, favoriser et participer aux efforts de développement de tous projets, dans le domaine du site concerné, des énergies renouvelables et de l'efficacité énergétique ; promouvoir la découverte et l'accès à la nature et, d'une manière générale, agir pour la sauvegarde de ses intérêts dans le domaine du site concerné, à savoir les espaces naturels du camping "les Ecolodges des 3 lacs" et abords et sur le territoire de la commune de Rochebrune (05190) ; développer le goût et l'intérêt du plus grand nombre, par et pour la connaissance et la protection de la nature, des milieux et de l'environnement en proposant des actions pédagogiques ouvertes à  tous publics (institutions, organismes, écoles, tourisme, etc
) à la découverte du territoire local

promouvoir, développer, organiser, faciliter la pratique de l'ULM, des drones et des différentes activités s'y rattachant, notamment par des opérations de découverte auprès du public, par la formation et l'entraînement des pilotes, tant à l'aide de moyens privés que des moyens publics, à effet de préparer aux carrières aéronautiques, à la construction aéronautique, à l'instruction technique ou aux métiers s'y rattachant ; faire respecter les règles et les règlements techniques et déontologiques ; exercer un pouvoir disciplinaire, dans le respect des principes généraux du droit, à l'égard des membres ; 
développer l'esprit aéronautique particulièrement dans la jeunesse, de veiller à ce que le vol moteur, école de maîtrise individuelle et activité d'équipe, soit à la fois une activité de formation, de sport et de loisir ; participer à l'étude, la réalisation et la gestion d'infrastructures aéronautiques : aérodromes, avitaillement, installations techniques et d'accueil ; l'association, affiliée à la Fédération Française d'ULM « FFPLUM » s'engage à se conformer entièrement aux règlements établis par la Fédération, les Comités Régionaux et le Comité National Olympique et Sportif Français ; 
Elle peut par ailleurs adhérer à d'autres associations, unions ou regroupements par décision du comité directeur

venir en aide en tout genre de moyens et à toute catégorie de population ; éduquer et sensibiliser la population aux bonnes valeurs humaines et écologiques ; défendre les droits des étrangers (séjour, vie en famille, asile, santé, travail, droits civiques) et participer à l'évolution de la législation ; multiplier les espaces de rencontres entre étrangers et français, découvrir les cultures respectives et modifier les représentations, créer des passerelles entre français et étrangers pour développer les liens sociaux, uvrer à plus de solidarité, apprendre à vivre ensemble ; assurer une éducation populaire en organisant des formations sur des thèmes particuliers concernant les cultures, les sociétés, la géopolitique dans les différents continents ; assurer l'information et la formation juridique des étrangers, des personnes ressources, des travailleurs sociaux, des membres d'associations issues de la société civile sur la réglementation concernant les étrangers ; sensibiliser l'opinion publique, les partenaires sociaux et politiques, les associations, les collectifs à la situation des étrangers et obtenir leur appui dans des interventions visant à son amélioration, au niveau local, national et européen ; la formation ainsi que l'insertion et la réinsertion professionnelle de la femme et de l'enfant ; développer et promouvoir la santé de la mère et de l'enfant ainsi que la formation et la réinsertion professionnelle, accompagnement non médical à la naissance, au niveau local, régional, national et international ; favoriser l'humanisation dans les domaines de la naissance et de la petite enfance en général ; promouvoir, défendre et diffuser les droits de l'homme, son action s'appuie sur la convention internationale des droits de l'enfant adoptée par l'assemblée générale de l'ONU le 20 novembre et entrée en vigueur le 2 septembre 1990 ; rechercher des moyens susceptibles de favoriser le plein épanouissement physique, moral et intellectuel de l'enfant ; 
s'occuper avec une attention particulière des plus démunis ; informer et sensibiliser les enfants et leur entourage afin d'améliorer la prévention de la violence ; améliorer la qualité de l'accompagnement des enfants victimes de violence ; la prévention, la promotion, la protection des droits de l'enfant ; aider toutes personnes qui adhèrent à nos idées pour le développement, la santé et l'éducation en France ou à l'Internationale ; apporter aide matérielle aux écoles dans les pays en voie de développement,  fournitures scolaires tableaux, livres, cahiers, stylos ; le soutien des familles et de façon plus générale toute action se rattachant directement ou indirectement à cet objectif ou à un objectif similaire ou connexe ; 
l'association mettra en place, le suivi et l'évaluation des projets en matière de soins de santé, de violence conjugale et faits prostitutionnels, en matière d'éducation, des loisirs, de formation dans le cadre d'une coopération locale et internationale, l'association créera des lieux d'accueil, d'écoute et d'accompagnement pour protéger les enfants et soutenir les parents
